        <a
          href="https://github.com/ElizaRegas"
          target="_blank"
          rel="noopener noreferrer"
        >
          <HoverImage 
            src={github} 
            hoverSrc={githubPink} 
            className="icons" 
          />
        </a>
        <a
          href="https://twitter.com/elizaregas"
          target="_blank"
          rel="noopener noreferrer"
        >
          <HoverImage 
            src={twitter} 
            hoverSrc={t} 
            className="icons" 
          />
        </a>
      </div>
      <div id="footerStop"></div>
    </div>
  );
};

export default Footer;
